import logo from './logo.svg';
import './App.css';

function App() {

  function handleClick(event) {
    console.log("you clicked the button. icely done.")
    console.log(event)

    const requestOptions = {
      method: 'GET'
    }

    fetch('https://localhost:5000/api/getter', requestOptions) // Make rquest to this endpoint
      .then(response => response.json()) // Not json format when received so turn it into json
      .then(data => console.log(data))



  }

  return (
    <div className="App">
      <p>response: </p>
      <button onClick={handleClick}> Click to GET</button> 
    </div>
  );
}

export default App;
